description.nl:
Informatie over de omvang van de uitvoer en invoer uit Oekraïne beschikbaar volgens de International Standard Trade Classification (SITC).
  Materieel toepassingsgebied: Gegevens van entiteiten die zich bezighouden met de uitwisseling van goederen in de internationale handel

Persoonlijk toepassingsgebied: Rotatie per grondstof

Updatefrequentie: Maand
 Bron van gegevens:

Verzameling: RCSP — Register van burgerluchtvaartuigen;
Scheepsregister;Informatiesysteem voor de aankoop/verkoop van vis;
Een informatiesysteem met gegevens uit statistische aangiften over gecentraliseerde vrijmaking tussen twee of meer EU-landen;AIS/INTRASTAT — subsysteem INTRASTAT;
AIS — Automatisch invoersysteem;AES — Automatisch exportsysteem;
Informatiesysteem voor de handel in elektriciteit en gas

Gestor:De burgerluchtvaartautoriteit;
Maritieme kamer;Ministerie van Maritieme Economie en Binnenvaart;
Ministerie van Financiën; Ministerie van Energie

Definities van termen:

Invoer van goederen — levering van goederen uit het buitenland, ongeacht de manier waarop ze in het economische gebied van het land worden binnengebracht. 
 De omvang van de invoer wordt beheerst door de aanbevelingen van het ministerie van Statistiek van de Verenigde Naties. 


Uitvoer van goederen — levering van goederen naar het buitenland ongeacht de wijze van vertrek uit het economische gebied van het land.



De omvang van de uitvoer van goederen wordt beheerst door de aanbevelingen van het ministerie van Statistiek van de Verenigde Naties.

