  Alcance material: Datos de entidades dedicadas al intercambio de bienes en el comercio internacional

Ámbito personal: Rotación por mercancía

Frecuencia de actualización: Mes
 Fuente de datos:

Colección: RCSP — Registro de aeronaves civiles;
Registro del buque;Sistema de información para la compra/venta de pescado;
Un sistema de información que contenga datos procedentes de declaraciones estadísticas sobre la liquidación centralizada entre dos o más países de la UE;Subsistema AIS/INTRASTAT — INTRASTAT;
AIS — Sistema de importación automática;AES — Sistema automático de exportación;
Sistema de información para el comercio de electricidad y gas

Gestor:
Autoridad de Aviación Civil;
Cámara marítima;
Ministerio de Economía Marítima y Navegación Interior;
Ministerio de Hacienda;
Ministerio de Energía



Definiciones de términos:



Importación de mercancías: entrega de mercancías desde el extranjero, independientemente de la forma en que se introduzcan en el territorio económico del país.



El alcance de las importaciones se rige por las recomendaciones del Departamento de Estadística de las Naciones Unidas.



Exportación de mercancías: entrega de mercancías en el extranjero, independientemente del método de salida del territorio económico del país.



El alcance de las exportaciones de bienes se rige por las recomendaciones del Departamento de Estadística de las Naciones Unidas.

